556	318615	Fragments d'un parcours amoureux	2025-06-04	Documentaire	95	Depuis ses 16 ans, entre Paris et Rome, Chloé a filmé ses amours. Coup de cœur adolescent, relation à distance, passion charnelle... alors qu’elle vivait une histoire, elle en fabriquait déjà le souvenir. Mais de quoi se souviennent ces ex ? Quelle est leur version des faits ? Douze d’entre eux se livrent pour reconstituer un parcours sentimental aussi singulier qu’universel.	https://fr.web.img2.acsta.net/img/7e/ff/7effca6b50e55da81879a9c4d919e301.jpg	2025-09-12 15:08:24.30708	FRENCH, ITALIAN	f	Chloé Barreau	Frammenti di un percorso amoroso
557	1000001353	Tom le chat - À la recherche du doudou perdu	2025-06-18	Animation	62	Tom est un petit chat roux malicieux. Curieux, joyeux… mais aussi un peu têtu. Quand il perd son doudou préféré, celui avec lequel il dort chaque nuit depuis qu’il est petit, c’est la catastrophe. Pas question de rester les pattes croisées : il faut le retrouver ! Heureusement, Tom peut toujours compter sur Chat-Souris, sa meilleure amie, pour le suivre dans ses aventures. C’est donc parti pour une folle expédition : il n’y a pas un endroit qu’ils n’inspecteront pas ! Mais… où est donc passé ce doudou ?!	https://fr.web.img6.acsta.net/img/a9/d2/a9d272cef07064d86d56e409d5d9a256.jpg	2025-09-12 15:09:06.102533	DUTCH	f	Erick Verkerk | Joost Van Den Bosch	Dikkie Dik en de verdwenen knuffel
