560	111044	Pusher	2025-07-09	Policier, Thriller, Action	105	A Copenhague, Frank vend de l'héroïne et fréquente le milieu de la petite criminalité. Sa dette envers le trafiquant serbe Milo l'incite à tenter un gros coup. Mais la police fait irruption pendant la transaction, et au cours de la poursuite qui s'ensuit, Frank perd à la fois la marchandise et l'argent. De rage, Frank expédie à l'hôpital son acolyte Tonny. Mais Milo commence à s'impatienter et se fait menaçant. L'urgence de rassembler une importante somme d'argent pousse Frank à multiplier les imprudences. Il va jusqu'à solliciter quelques couronnes auprès de sa mère qu'il n'a pas vue depuis longtemps. En désespoir de cause, il achète une arme, et blesse l'homme de main de Milo avant de s'enfuir. Désormais en grave danger, il convainc son amie de l'aider à monter une ultime arnaque qui devrait lui permettre de quitter le pays dans les heures qui suivent...	https://fr.web.img5.acsta.net/img/d1/3f/d13f0311a7e143de4c89a8a29aafe52f.jpg	2025-09-12 15:09:11.70971	DANISH, SERBO_CROAT, SWEDISH	f	Nicolas Winding Refn	Pusher
561	8368	Cure	2021-07-28	Policier, Judiciaire, Epouvante-horreur, Thriller	115	Un officier de police, Takabe, enquête sur une série de meurtres dont les victimes sont retrouvées avec une croix gravée dans le cou. Un jour, un jeune vagabond est arrêté près de l'endroit ou a été retrouvé le dernier corps. Il est vite identifié comme un ancien étudiant en psychologie, devenu fou et ayant d'inquiétants pouvoirs hypnotiques, lui permettant de pousser des gens à commettre des actes criminels...	https://fr.web.img3.acsta.net/pictures/21/09/23/10/26/3917322.jpg	2025-09-12 15:11:07.276391	JAPANESE	f	Kiyoshi Kurosawa	Kyua
562	34816	Kaïro	2001-05-23	Fantastique, Epouvante-horreur, Thriller	117	Taguchi, un jeune informaticien, est retrouvé pendu dans son appartement. Sous le choc, ses collègues cherchent à en savoir plus sur ce suicide inexplicable. La victime a laissé un mystérieux message contenu dans une simple disquette. De toute évidence, celle-ci recèle un virus qui contamine ses utilisateurs et a de graves répercussions sur leur comportement. A Tokyo, l'inquiétude grandit au fur et à mesure que le virus se propage à travers les réseaux informatiques. Des petits groupes de jeunes gens tentent de résister, tandis que les disparitions se multiplient.	https://fr.web.img3.acsta.net/medias/nmedia/00/02/26/88/69198710_af.jpg	2025-09-12 15:11:07.279149	JAPANESE	f	Kiyoshi Kurosawa	Kairo
563	135063	Gran Torino	2025-09-12	Drame	116	Walt Kowalski est un ancien de la guerre de Corée, un homme inflexible, amer et pétri de préjugés surannés. Après des années de travail à la chaîne, il vit replié sur lui-même, occupant ses journées à bricoler, traînasser et siroter des bières. Avant de mourir, sa femme exprima le voeu qu'il aille à confesse, mais Walt n'a rien à avouer, ni personne à qui parler. Hormis sa chienne Daisy, il ne fait confiance qu'à son M-1, toujours propre, toujours prêt à l'usage... Ses anciens voisins ont déménagé ou sont morts depuis longtemps. Son quartier est aujourd'hui peuplé d'immigrants asiatiques qu'il méprise, et Walt ressasse ses haines, innombrables - à l'encontre de ses voisins, des ados Hmong, latinos et afro-américains "qui croient faire la loi" , de ses propres enfants, devenus pour lui des étrangers. Walt tue le temps comme il peut, en attendant le grand départ, jusqu'au jour où un ado Hmong du quartier tente de lui voler sa précieuse Ford Gran Torino... Walt tient comme à la prunelle de ses yeux à cette voiture fétiche, aussi belle que le jour où il la vit sortir de la chaîne. Lorsque le jeune et timide Thao tente de la lui voler sous la pression d'un gang, Walt fait face à la bande, et devient malgré lui le héros du quartier. Sue, la soeur aînée de Thao, insiste pour que ce dernier se rachète en travaillant pour Walt. Surmontant ses réticences, ce dernier confie au garçon des "travaux d'intérêt général" au profit du voisinage. C'est le début d'une amitié inattendue, qui changera le cours de leur vie. Grâce à Thao et sa gentille famille, Walt va découvrir le vrai visage de ses voisins et comprendre ce qui le lie à ces exilés, contraints de fuir la violence... comme lui, qui croyait fermer la porte sur ses souvenirs aussi aisément qu'il enfermait au garage sa précieuse Gran Torino...	https://fr.web.img6.acsta.net/medias/nmedia/18/67/90/93/19057560.jpg	2025-09-12 15:12:08.848239	ENGLISH	f	Clint Eastwood	Gran Torino
